import React from 'react'
import styles from './Dialogs.module.css'


const DialogItem = (props) => {
  return(
    <>
      <div> {props.name} </div>
      <div>{props.message}</div>
      </>
  )}

export default function Dialogs() {
  return (
    <>
   <DialogItem name={'Sasha'} message={'lorem'} />
   </>
  )
}
